import React from "react";
import { NavLink } from 'react-router-dom';
import './RR.css'
const NavBar = (()=>{
    return(
        <>
                <div className="Navbar">
                <NavLink exact activeClassName= "active" to="/contact">ContactUs </NavLink>
                <NavLink exact to="/contact/about">AboutUs </NavLink>
                <NavLink exact to="/contact/services">Services </NavLink>
                <NavLink exact to="/contact/services">Services </NavLink>
                </div>

        </>
    )
})
export default NavBar
